import * as React from "react";
function Contact() {
  return (
    <div>
      <div style={{padding}}>
        <form>
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
}

export default Contact;
